description:
Visiting the Mountain Gorillas in Uganda and Rwanda

Nature Documentary hosted by Puk Daniels, published by Danson Movies in 2003 - Dutch, English Multilanguage narration


Information
------------------------------

Personal video record of Puk &amp; Marie Ange Daniels visit to the Mountain Gorilla's in Rwanda and Uganda.
In 2003 we spend more then 5 weeks in Uganda. Inspired by the film about Dian Fossey, &quot;Gorillas in the mist&quot; , our main reason to visit Uganda was to see the endangered mountain gorillas in their natural habitat. And yes, we met them! It was an unforgettable experience to be so close to these giant and fascinating animals. But we found out that Uganda is more than gorilla tracking. A beautiful green country with mountains, flatlands, lakes, a lot of wildlife and very friendly people.

